import React, {useEffect} from 'react';
import './../styles/footer.css';
import instagram_logo from './../assets/instagram-logo.png';
import slack_logo from './../assets/slack-logo.png';
import discord_logo from './../assets/discord.png';
import github_logo from './../assets/github-logo.png';
import { gsap } from 'gsap';
import { ScrollToPlugin } from 'gsap/ScrollToPlugin';

function Footer() {
    useEffect(() => {
        const li_contact_perso = document.querySelectorAll('.li_contact_perso');
        const element_contact = document.querySelectorAll('.element_contact');
        const li_contact_media = document.querySelectorAll('.li_contact_media');
        const info_contact_box = document.querySelectorAll('.info_contact_box');
        const info_contact_box_text = document.querySelectorAll('.info_contact_box_text');
        const info = document.querySelector('.info');

        gsap.registerPlugin(ScrollToPlugin);

        gsap.fromTo(info, {
            opacity: 0,
            y: 0,
            scale: 2.5,
        }, {
            opacity: 1,
            y: -200,
            scale: 1.3,
            border: '1px solid #4446c1',
            borderRadius: '10px',
            padding: '20px 10vw',
            duration: 1,
            scrollTrigger: {
                trigger: info,
                marginTop: '100px',
                marginBottom: '100px',
                start: 'top 80%',
                toggleActions: 'play none none reverse',
            }
        });

        const animationContact = gsap.timeline({
            yoyo: true,
            repeat: -1,
            y: 10,
            duration: 1,
        });

        element_contact.forEach((element) => {

            element.addEventListener('mouseover', () => {
                animationContact.paused();
                gsap.to(element, {
                    y: -10,
                    duration: 1,
                });
            });
            element.addEventListener('mouseout', () => {
                animationContact.play();
                gsap.to(element, {
                    y: 0,
                    duration: 1,
                });
            });
        });

        gsap.fromTo(li_contact_perso, {
            opacity: 0,
            y: 50,
        }, {
            opacity: 1,
            y: 0,
            duration: 1,
            stagger: 0.2,
            scrollTrigger: {
                trigger: info_contact_box,
                marginTop: '100px',
                marginBottom: '100px',
                start: 'top 80%',
                toggleActions: 'play reverse none reverse',
            }
        });

        animationContact.play();

    }, []);
    return (
        <footer className="footer">
            <div className="info">
                <div className="info_contact_title">
                    <p className="info_contact_title_p">Corentin Albertus</p>
                    <h3 className="info_contact_title_h3">Contactez-moi</h3>
                </div>
                <div className="info_contact">
                    <div className="element_contact info_contact_box">
                        <h4 className="info_contact_box_text info_contact_box_title">Contact</h4>
                        <p className="info_contact_box_text info_contact_box_adress">199 rue eugenie cotton</p>
                        <p className="info_contact_box_text info_contact_box_city">34000 Montpellier</p>
                        <p className="info_contact_box_text info_contact_box_country">France</p>
                    </div>
                    <div className="info_contact_social">
                        <ul className="ul_second_header">
                            <li className="element_contact li_footer li_contact_perso">
                                <a className="info_contact_box_text" href="https://discord.com/">
                                    corentin.albertus@hotmail.com
                                </a>
                            </li>
                            <li className="element_contact li_footer li_contact_perso">
                                <a className="info_contact_box_text" href="https://discord.com/">
                                    06 50 50 50 50
                                </a>
                            </li>
                        </ul>
                        <ul className="ul_second_header_media">
                            <li className="element_contact li_footer li_contact_media">
                                <a href="https://discord.com/">
                                    <img className="logo_discord" src={discord_logo} alt="discord" width={20} height={20}/>
                                </a>
                            </li>
                            <li className="element_contact li_footer li_contact_media">
                                <a href="https://www.instagram.com/">
                                    <img className="logo_instagram" src={instagram_logo} alt="instagram" width={20} height={20}/>
                                </a>
                            </li>
                            <li className="element_contact li_footer li_contact_media">
                                <a href="https://slack.com/">
                                    <img className="logo_slack" src={slack_logo} alt="slack" width={20} height={20}/>
                                </a>
                            </li>
                            <li className="element_contact li_footer li_contact_media">
                                <a href="https://github.com/">
                                    <img className="logo_github" src={github_logo} alt="github" width={20} height={20}/>
                                </a>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
            <div className="legacy">
                <a className="copyright" href="https://www.legalplace.fr/">Copyrights Â© 2023. Corentin Albertus</a>
            </div>
        </footer>
    );
}

export default Footer;
